    if len(b) == 2:
        (k, b) = (b[0], b[1])
        a = prefix_dict[k]
    else:
        b = b[0]
        a = 0
    s = 0
    for i in range(len(v)):
        if v[i] in '123456789':
            if i != 0:
                a -= i - 1
                if i != len(v) - 1:
                    v = v[i] + '.' + v[i + 1:]
                else:
                    v = v[i]
            else:
                try:
                    j = v[i:].index('.')
                    a += j - 1
                    v = v[0] + '.' + v[1:j] + v[j + 1:]
                except:
                    a += len(v) - 1
                    v = v[0] + '.' + v[1:]
            break
    return '{} * 10^{} {}'.format(v, a, b)

